	$delay = $delay + 1
else
	$delay = 0
endif

;autoUnderwater restore outfit
if $submerged_start == 0 && $delay >= $delayInFrames
	$change = 8
	$prevar = 0
	$delay = 0
endif

if $delay > $delayInFrames
    $delay = 0
endif


